import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Navbar, Nav, Container } from 'react-bootstrap';
import Profile from "../img/profile.png";
import 'bootstrap/dist/css/bootstrap.min.css';

const NavBar = () => {
    const [expanded, setExpanded] = useState(false);
    const navigate = useNavigate();

    const handleNavigation = (path) => {
        navigate(path);
        setExpanded(false);
    };

    const handleProfile = () => {
        navigate('/profile');
    };

    return (
        <Navbar bg="light" expand="lg" expanded={expanded}>
            <Container>
                <Navbar.Toggle 
                    aria-controls="basic-navbar-nav" 
                    onClick={() => setExpanded(expanded ? false : true)}
                />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="me-auto">
                        <Nav.Link onClick={() => handleNavigation("/dashboard")}>Introduction</Nav.Link>
                        <Nav.Link onClick={() => handleNavigation("/project-motivation")}>Project Motivation</Nav.Link>
                        <Nav.Link onClick={() => handleNavigation("/coding")}>Coding Lessons</Nav.Link>
                        <Nav.Link onClick={() => handleNavigation("/finance")}>Finance Lessons</Nav.Link>
                        <Nav.Link onClick={() => handleNavigation("/language")}>Language Lessons</Nav.Link>
                        <Nav.Link onClick={() => handleNavigation("/achievments")}>Achievments</Nav.Link>
                    </Nav>
                </Navbar.Collapse>
                <div className="ms-auto">
                    <img 
                        alt="ProfileIMG" 
                        src={Profile} 
                        onClick={handleProfile}
                        style={{ 
                            cursor: 'pointer',
                            width: '40px',
                            height: '40px',
                            borderRadius: '50%'
                        }} 
                    />
                </div>
            </Container>
        </Navbar>
    );
};

export default NavBar;
